contract WandInstruments {
    /*function someAction(address addr) returns(uint) {
        Callee c = Callee(addr);
        return c.getValue(100);
    }*/
    uint256 public growthFactor;
    uint256 public sellFactor;

    uint256 private backingPrice;

    uint256 private scepterBuyPrice;
    uint256 private scepterSellPrice;

    uint256 private treasuryUSDC;
    //addresses of Treasuries
    address public treasury1Addr;
    address public treasury2Addr;

    //view treasuries balances
    uint256 public treasury1bal = 500000*(10**18);

    //fortest
    uint256 private ft5daybought = 100000;
    uint256 private ft5daysold = 90000;
    uint256 private double5daytokens = 600000;
    uint256 private a = 9;
    uint256 private bc = 10;
    int128 public res;
    address public testwallet = 0x617F2E2fD72FD9D5503197092aC168c91465E7f2;

    //Scepter public scepterToken;
    //address public usdcToken= 0x291153a24E642A16e876aB68B4516f1a8EdadDD3;
    
    IERC20 public tSC;
    IERC20 public mockUSDC;

   // Scepter private s;
    Baton private b;
    constructor(address scepterAddr, address batonAddr) {   
         //s = Scepter(scepterAddr);
         b = Baton(batonAddr);

         tSC = IERC20(scepterAddr);
         mockUSDC = IERC20(0xD7ACd2a9FD159E69Bb102A1ca21C9a3e3A5F771B);
        treasury1Addr = 0x617F2E2fD72FD9D5503197092aC168c91465E7f2;
        //treasury1bal=treasury1Addr.balance;

        growthFactor=(ft5daybought/double5daytokens) * (10**18);
       // growthFactor=divide(ft5daybought,double5daytokens);
        sellFactor=ft5daysold/double5daytokens* (10**18);

        
        }

    function queryERC20Balance(address _tokenAddress, address _addressToQuery) view public returns (uint) {
        return ERC20Interface(_tokenAddress).balanceOf(_addressToQuery);
    }

   /* function mintScepter(uint256 amount) internal {
        
        tSC.mint(msg.sender, amount);
        
    }*/

    function sellScepter(uint256 amountSCPtoSell) public payable{
        //require(msg.sender == trader , "Not authorized");
        uint256 trader_tsc_balance = tSC.balanceOf(msg.sender);
        require(trader_tsc_balance > amountSCPtoSell, "You dont have that amount!");

       /* require(
            mockUSDC.allowance(owner2, address(this)) >= amount2,
            "Token 2 allowance too low"
        );*/
            //WAND to transfer USDC to seller
        mockUSDC.transfer(msg.sender, amountSCPtoSell + (1*(10**18)));
            //Transfer the sold tsc to WAND
        _safeTransferFrom(tSC, msg.sender, address(this), amountSCPtoSell);
        //tSC.transferFrom(msg.sender, address(this), amountSCPtoSell);
        //msg.sender.tSC.transfer(msg.sender, amountSCPtoSell + (1*(10**18)));
        //_safeTransferFrom(token2, owner2, owner1, amount2);
    }
    function buyScepter(uint256 amountSCPtoBuy) public payable{
        //require(msg.sender == trader , "Not authorized");
        uint256 trader_usdc_balance = mockUSDC.balanceOf(msg.sender);
        require(trader_usdc_balance > amountSCPtoBuy, "You dont have that amount!");

        //transfer the tSC to trader
        tSC.transfer(msg.sender, amountSCPtoBuy);
        //_safeTransferFrom(tSC, address(this), msg.sender, amountSCPtoBuy);
        //Transfer USDC to WAND from trader
        _safeTransferFrom(mockUSDC, msg.sender, address(this), amountSCPtoBuy);
        //tSC.transferFrom(msg.sender, address(this), amountSCPtoSell);
        //msg.sender.tSC.transfer(msg.sender, amountSCPtoSell + (1*(10**18)));
        //_safeTransferFrom(token2, owner2, owner1, amount2);

    }
    function mintBaton(uint256 amount) public {
        
        b.mint(msg.sender, amount);
        
    }

    function floorDiv(int256 a, int256 b) public returns (int256) {
    int256 r = SignedSafeMath.div(a, b);
    if ((a ^ b) < 0 && (r * b != a)) r--;
    return r;
}
    function getBackingPrice() external view returns (uint256){
        //floorPrice=;
        //treasuryUSDC = 2;
       
       return (treasury1bal/tSC.totalSupply())  ;
       // return 2;
    }
    function getBuyPrice() external view returns (uint256){
   
        return (this.getBackingPrice() * ((9/10) *(10**18) - sellFactor) / (10**18));
    }
    function getSellPrice() external view returns (uint256){
        //Sell price: (backing price * (1.2 + growth factor)) in USDC
        return (this.getBackingPrice() * (growthFactor + (6*(10**18)/5)))/ (10**18);
    }
    function _safeTransferFrom(
        IERC20 token,
        address sender,
        address recipient,
        uint256 amount
    ) private {
        bool sent = token.transferFrom(sender, recipient, amount);
        require(sent, "Token transfer failed");
    }

}
abstract contract ERC20Interface {
    function balanceOf(address whom) view public virtual returns (uint);
}
/*abstract contract Scepter {
   
    function mint(address addrTo, uint256 amount) public virtual ;
